import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import {
    AppBar,
    Toolbar,
    ListItem,
    IconButton,
    ListItemText,
    Avatar,
    Divider,
    List,
    Typography,
    Box,
    ListItemIcon
} from "@material-ui/core"
import {
    ArrowBack,
    AssignmentInd,
    Home,
    Apps,
    ContactMail
} from "@material-ui/icons"
import avatar from '../jonpic.jpg'

// CSS styles
const useStyles = makeStyles(theme=>({
    menuSliderContainer: {
        width: 250,
        background: "#494B64",
        height:"480px"
    },
    avatar: {
        display: "block",
        margin: "8px auto",
        width: theme.spacing(13),
        height: theme.spacing(13)
    }
}));

const lsItem = [
    {
        listIcon: <Home/>,
        listText: "Home"
    },
    {
        listIcon: <AssignmentInd/>,
        listText: "Resume"
    },
    {
        listIcon: <ContactMail/>,
        listText: "Contacts"
    }
]

const Navbar = () => {
    const classes = useStyles()
    return (
        <>
        <Box className={classes.menuSliderContainer} component="div">
        <Avatar className={classes.avatar} src={avatar} alt="Jonathan Winkles"/>
        <Divider/>
        <List>
            {menuItems.map((lsItem, Key)=>(
                <ListItem button key={key}>
                    <ListItemIcon>{lsItem.listIcon}</ListItemIcon>
                    <ListItemText primary={lsItem.listText}/>
                </ListItem>
            ))}
            
        </List> 
        </Box>
        <Box component="nav">
          <AppBar position="static" style={{background: "#111"}}>
              <Toolbar>
                <IconButton>
                  <ArrowBack style={{color: "#4E538F"}}/>
                </IconButton>
                <Typography variant="h5">
                    Jon Winkles
                </Typography>
              </Toolbar>
            </AppBar>  
        </Box>
        </>
    )
}

export default Navbar
